import React from 'react'
import { useState } from 'react'



export const Count = () => {

    const [num,setNum] = useState(0);

      const plus = () => {
        setNum(num + 1);
      }

      const sub = () => {
        setNum(num - 1);
      }

      const reset = () => {
        setNum(0);
      }

      const color = () => {
        var box = document.getElementsByClassName('box');
        box[0].style.backgroundColor = 'red';
        box[0].style.width = '200px';
        box[0].style.height = '200px';
        box[0].style.borderRadius = '50%';
        box[0].style.margin = 'auto';
        box[0].style.display = 'block';
        box[0].style.textAlign = 'center';
        box[0].style.lineHeight = '200px';
        box[0].style.fontSize = '50px';
        box[0].style.fontWeight = 'bold';
        box[0].style.color = 'blue';
        box[0].style.transition = 'all 0.5s';
        box[0].style.boxShadow = '0 0 10px #000';
        box[0].style.border = 'none';
        box[0].style.outline = 'none';
      }

  return (
    <div> <br />
        <h2>This is the Count component</h2>

        <div class='box'></div> <br />
        <button onClick={color}>color change</button>

        <h1>{num}</h1>
        <button onClick={plus}>+</button> &nbsp;
        <button onClick={sub}>-</button> &nbsp;
        <button onClick={reset}>reset</button> <br /><br />
    </div>
  )
}
